import db from "./appwriteConfig.js";

const createRecipe = (newRecipe) => {
  db.createDocument("61319d3498a39", newRecipe)
    .then((res) => {
      console.log(res);
    })
    .catch((err) => {
      console.log(err.message);
    });
};

export default createRecipe;
